    [],nt"num_tags": 4,nt"name": "lake-andes-national-wildlife-refuge-narrative-report-september-to-december-1957",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Lake Andes NWR
    outlines Refuge accomplishments from September through December of 1957. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    fish, reptiles, and disease- is also covered. The Refuge development and maintenance
    section discusses collections and receipts and vegetation control. Resource management
    is outlined; topics include grazing and timber removal. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, and violations. Items of interest and N-R forms are attached.",nt"owner_org":
